import React from 'react';
import TopScorers from '../components/TopScorers';

class Home extends React.Component {
  state = {
    topScorers: [
      {
        playerId: 1,
        name: 'Joe Bloggs',
        goals: 0
      },
      {
        playerId: 2,
        name: 'Lionel Messi',
        goals: 5
      },
      {
        playerId: 3,
        name: 'Neil Dewing',
        goals: 19
      }
    ]
  };

  render() {
    return (
      <>
        <h1>FootyScores</h1>
        <hr />
        <TopScorers topScorers={this.state.topScorers} />
        <hr />
        <h2>Previous Result</h2>
        <hr />
        <h2>Next Match</h2>
      </>
    );
  }
}

export default Home;
